import { Project } from '../Interfaces/Interfaces';
import { ObjectId } from 'mongodb';

export const getProjects: () => Promise<Project[]> = async () => {
    // return made up data composed of two projects
    const project1: Project = {
      name: "Project 1",
      startDate: new Date(),
      endDate: new Date(),
      isCompleted: false,
      xp: 0,
      workers: 0,
      context: "Context 1",
      goal: "Goal 1",
      description: "Description 1",
      steps: []
    };
    project1.steps.push({
      name: "Step 1",
      duration: 0,
      xp: 0,
      projectId: null
    });
    project1.steps.push({
      name: "Step 2",
      duration: 0,
      xp: 0,
      projectId: new ObjectId()
    });
    project1.steps.push({
      name: "Step 3",
      duration: 0,
      xp: 0,
      projectId: new ObjectId()
    });

    const project2: Project = {
      name: "Project 2",
      startDate: new Date(),
      endDate: new Date(),
      isCompleted: false,
      xp: 0,
      workers: 0,
      context: "Context 2",
      goal: "Goal 2",
      description: "Description 2",
      steps: []
    };
    project2.steps.push({
      name: "Step 1",
      duration: 0,
      xp: 0,
      projectId: new ObjectId()
    });
    project2.steps.push({
      name: "Step 2",
      duration: 0,
      xp: 0,
      projectId: new ObjectId()
    });
    project2.steps.push({
      name: "Step 3",
      duration: 0,
      xp: 0,
      projectId: new ObjectId()
    });

    return [project1, project2];
  };
